import { Link } from "react-router-dom";
import "./nav.css";

function Nav(props) {
  function handleAvailableClick() {
    props.setClaimedUrl(
      "https://book-swap-api.dev.io-academy.uk/api/books?claimed=0"
    );
  }

  function handleClaimedClick() {
    props.setClaimedUrl(
      "https://book-swap-api.dev.io-academy.uk/api/books?claimed=1"
    );
  }

  return (
    <nav className="navBar">
      <a href="/" className="bookSwap">Books Swap</a>
      <div className="right-links">
        <Link alink='#8783D1' to="/" onClick={handleAvailableClick}>
          Available books
        </Link>
        <Link alink='purple' to="/" onClick={handleClaimedClick}>
          Claimed Book
        </Link>
        <Link to="/add-book">Add book</Link>
      </div>
    </nav>
  );
}

export default Nav;
